contracts/utils/Create2Example2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

// create2 - deterministically precompute contract address

contract Factory {
    // 1. Get bytecode of contract to be deployed
    function getBytecode(address _owner, uint256 _foo) public pure returns (bytes memory) {
        bytes memory bytecode = type(TestContract).creationCode;
        // append contructor for deployment contract arguements to bytecode
        return abi.encodePacked(bytecode, abi.encode(_owner, _foo));
    }
    // 2. Compute the address of the contract to be deployed
    // keccak256(0xff + sender address _
    // 3. Deploy the contract
}

contract TestContract {
    address public owner;
    uint256 public foo;

    constructor(address _owner, uint256 _foo) payable {
        owner = _owner;
        foo = _foo;
    }

    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }
}

